UPDATE `scoringsystem_review` SET `review_user_id_id` = 3276, `review_business_id_id` = 18786, `review_stars` = 3, `review_text` = 'Overhyped for sure. \n\nI was dining alone and decided to stop for lunch since I know they get crazy busy at night. The menus are mostly the same with a few sandwiches and a blue plate special for $15 (2 pc fried chicken).  Because I was alone I was gently encouraged to sit at the bar (sigh....) which is always a little disappointing. \n\nI had a small plate (2 biscuit sliders) and a glass of wine and it was around $40. That\'s insane - I know it\'s Vegas and all, but come on. Wine by the glass is pretty much in the $15 range as are most cocktails. I did appreciate that they let me mix my sliders - I had one fried chicken and one ham/cheddar. Both were good but not great, as the biscuits were maybe a little under baked and doughy. \n\nThat said the actual fried chicken was excellent so definitely go that route. I\'m glad I tried it for sure, but I wouldn\'t rush back.', `review_date` = '2018-10-07 16:25:07', `review_useful_vote` = 5, `review_funny_vote` = 3, `review_cool_vote` = 2 WHERE `scoringsystem_review`.`id` = 14769;
